import React from 'react';
import './Avilable.css';
import Avilableitem from './Avilableitem';


function Avilable() {
  const sampleType = 'Sample Type1';
  const sampleBrand = 'Sample Brand1';
  const sampleLocation = 'Sample Location1';
  const sampleDate = 'Sample Date1';
  return (
    <div className='avilable-main'> 
        <span>Avilable</span>
        <div className='avilable-main-list'>
        <Avilableitem
        type={sampleType}
        brand={sampleBrand}
        location={sampleLocation}
        date={sampleDate}
        />
        </div>
    </div>
    
  )
}

export default Avilable
